export default function HomeContent() {
  const [value, setValue] = React.useState(0);

  const [isOpen, setIsOpen] = useState(false);
  const [currentTaskList, setCurrentTaskList] = useState([]);
  const [previousTaskList, setPreviousTaskList] = useState([]);

  const openPopup = () => {
    setIsOpen(true);
  };

  const handleChange = (event, Value) => {
    setValue(Value);
  };

  useEffect(() => {
    axios
      .get(`http://localhost:3001/requests/current`)
      .then((response) => {
        setCurrentTaskList(response.data);
      })
      .catch((error) => {
        console.log(error);
      });
  }, []);

  useEffect(() => {
    axios
      .get(`http://localhost:3001/requests/previous`)
      .then((response) => {
        setPreviousTaskList(response.data);
      })
      .catch((error) => {
        console.log(error);
      });
  }, []);

  function createData(taskId, raisedBy, department, date, category, status) {
    return { taskId, raisedBy, department, date, category, status };
  }

  const rowsCurrent = currentTaskList.map((value, key) => {
    return createData(
      value.RequestId.toString(),
      value.userTableEmployeeId.toString(),
      value.Department.toString(),
      value.CreatedDate.toString(),
      value.Category.toString(),
      value.Status.toString()
    );
  });
  const rowsPrevious = previousTaskList.map((value, key) => {
    return createData(
      value.RequestId.toString(),
      value.userTableEmployeeId.toString(),
      value.Department.toString(),
      value.CreatedDate.toString(),
      value.Category.toString(),
      value.Status.toString()
    );
  });

  return (
    <>
      <AddRequestUser isOpen={isOpen} setIsOpen={setIsOpen}></AddRequestUser>
      <Box sx={{ width: "100%" }}>
        <Box sx={{ borderBottom: 1, borderColor: "divider" }}>
          <Tabs
            value={value}
            onChange={handleChange}
            aria-label="basic tabs example"
          >
            <Tab label="Current Tasks" {...a11yProps(0)} />
            <Tab label="Previous Tasks" {...a11yProps(1)} />
            {/* <Tab label="Item Three" {...a11yProps(2)} /> */}
          </Tabs>
        </Box>
        <TabPanel value={value} index={0}>
          <Row>
            <HomeTable1 rows={rowsCurrent} />
          </Row>
          <Row>
            <Button
              variant="contained"
              style={{
                backgroundColor: " #FB6340",
                position: "absolute",
                marginLeft: "85%",
                marginTop: "10px",
              }}
              onClick={openPopup}
            >
              ADD REQUEST
            </Button>
          </Row>
        </TabPanel>
        <TabPanel value={value} index={1}>
          <Row>
            <HomeTable1 rows={rowsPrevious} />
          </Row>
        </TabPanel>
        {/* <TabPanel value={value} index={2}>
        Item Three
      </TabPanel> */}
      </Box>
    </>
  );
}
